      };
};


const mapDispatchToProps = (dispatch, ownProps) => {
  return {};
};


class SignOutButton extends Component {
  render() {
    return (
      <ul className="navbar-nav ">
        <li className="nav-item">
          <a className="nav-link" href="/login">
            <i className="fa fa-sign-out" aria-hidden="true"></i>
            Sign-Out
